import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { NavbarComponent } from './navbar/navbar.component';
import { Module1aComponent } from './Modules/module1a/module1a.component';
import { Module2aComponent } from './Modules/module2a/module2a.component';
import { Module3aComponent } from './Modules/module3a/module3a.component';
import { ButtonComponent } from './button/button.component';
import { FooterComponent } from './footer/footer.component';
import { TextItemComponent } from './text-item/text-item.component';
import { Module2bComponent } from './Modules/module2b/module2b.component';
import { Module1bComponent } from './Modules/module1b/module1b.component';
import { Module3bComponent } from './Modules/module3b/module3b.component';

@NgModule({
  declarations: [
    AppComponent,
    NavbarComponent,
    Module1aComponent,
    Module2aComponent,
    Module3aComponent,
    ButtonComponent,
    FooterComponent,
    TextItemComponent,
    Module2bComponent,
    Module1bComponent,
    Module3bComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
